import BrowserRouter from "react-router-dom";
import Home from "./pages/Home/Home";
import "./App.css";
import { Route } from "react-router";

function App() {
	return (
		<BrowserRouter>

			<div className="app">
				<Route path = "/" component = {Home} exact></Route>
			</div>

		</BrowserRouter>
	);
}

export default App;
